def get(url):
	time.sleep(1)
	return requests.get(url, headers={'User-agent': 'Mozilla/5.0'}).content

def downloadFile(url,name):
	contents = get(url)
	with open(name, "wb") as local_file:
		local_file.write(contents)

for ship in shipURLS:
	vals = ship.split("|");
	print ("Downloading " + vals[0] + " | " + vals[1])
	response = get(vals[1])
		
	downloadFile(vals[1], "..\ships\%s.png" % (vals[0]))


